import React from 'react';
import './Progress.css';

function Progress() {
  return (
    <section id="progress">
      <h2>Прогрес</h2>
      <div className="progress-container">
        <div className="progress-bar"></div>
      </div>
      <p className="progress-text">Прогрес: 0%</p>
    </section>
  );
}

export default Progress;
